import Header from './Header';

const Layout = (props) => {
    return (
        <div>
            <Head>
                <title>Hj√§rtan av guld UF</title>
                <link rel="stylesheet" href="https://bootswatch.com/4/flatly/bootstrap.min.css" />
            </Head>
            <Header />
            {props.children}
        </div>
    )
};

export default Layout;
